import React from "react";


const Card=( {robot, key})=>{

	return (
		<div className="tc grow bg-light-green br3 pa3 ma2" >
			<img src={`https://robohash.org/${robot.id}?size=200x200`} alt='robots' />
			<text> {robot.name}	</text>
			<text> {robot.email}	</text>
		</div>
	);
}

export default Card;
